import React from 'react';
import styled from 'styled-components';
import HomeCard from './components/homecard';

const CardsWrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  gap: -5px; /* Espace entre les cartes */
  background-color: #8B2514; /* Couleur de fond pour correspondre à votre exemple */
  padding: 50px;
`;

const App = () => {
  return (
    <CardsWrapper>
      <HomeCard image="/path-to-image/june-baby.png" rotate="-5deg" />
      <HomeCard image="/path-to-image/love-yourself.png" rotate="0deg" />
      <HomeCard image="/path-to-image/love.png" rotate="5deg" />
    </CardsWrapper>
  );
};

export default App;
